import React from 'react';
import './Header.css';

const Header = ({ onLogout }) => {
  return (
    <header className="header">
      <h1>Event management system</h1>
      <button className="logout-btn" onClick={onLogout}>
        Logout
      </button>
    </header>
  );
};

export default Header;
